import React from 'react'

export default class Game extends React.Component {
    constructor(){
        super();
        this.state = {};
    }


    render(){
        return (
            <div className='game'>
               <header>
                   <div id='timer'>00:00:00.0</div>
                   <div className='counter'>0</div>
               </header>
               <div className='playField'>
                   <div className='card'>1.1</div>
                   <div className='card'>1.2</div>

                   <div className='card'>1.3</div>
                   <div className='card'>2.1</div>

                   <div className='card'>2.2</div>
                   <div className='card'>2.3</div>

                   <div className='card'>3.1</div>
                   <div className='card'>3.2</div>
               </div>
               <div>
                   <button type='submit'>RESTART</button>
                   <button type='reset'>new game</button>
               </div>
            </div>
        );
    }
}
